import connectstyles from '../../src/Connect.module.scss';
import React, { Component } from "react";
import { Link } from 'react-router-dom';
import aclu from './aclu2@2x.png';

class Connect extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div className={styles.main}>
                {/* <h1 className={styles.Header}>Connect for Black Lives</h1>
                <p>FInd civic organizations in your area that you can support</p>
                <strong>There are 6 local civic organizations in your area</strong> */}

                <div class={connectstyles.gridContainer}>
                    <div class={connectstyles.item1}>
                        <h1 className={styles.Header}>Connect for Black Lives</h1>
                <p>FInd civic organizations in your area that you can support</p>
                <strong>There are 6 local civic organizations in your area</strong>
                    </div>
                    <div class={connectstyles.item2}>Menu</div>
                    <div class={connectstyles.item3}>
                    <img src={aclu} alt= "American Civil Liberties" height={62} width={93}/>
                        </div>  
                    <div class={connectstyles.item4}>
                        <strong>American Civil Liberties</strong>
//                                 <p>Location: New York, NY</p>
//                                 <p><a href="https://www.aclu.org/affiliate/new-york">Visit Website</a></p>
                    </div>
                    <div class={connectstyles.item5}>main2</div>
                    <div class={connectstyles.item6}>main3</div>
                    <div class={connectstyles.item7}>main4</div>
                    <div class={connectstyles.item8}>main5</div>
                    <div class={connectstyles.item9}>mainb</div>
                    <div class={connectstyles.item10}>mainb1</div>
                    <div class={connectstyles.item11}>mainb2</div>
                    <div class={connectstyles.item12}>main3</div>
                    <div class={connectstyles.item13}>main4</div>
                    <div class={connectstyles.item14}>mainb5</div>
                </div>


            </div>
        )
    }
}

export default Connect;
